import React, { useState } from 'react';

// Sample products data
const sampleProducts = [
  {
    id: 1,
    name: 'Margherita Pizza',
    price: 12.99,
    description: 'Fresh tomatoes, mozzarella, basil',
    category: 'Pizza'
  },
  {
    id: 2,
    name: 'Chicken Burger',
    price: 15.99,
    description: 'Grilled chicken with lettuce and tomato',
    category: 'Burger'
  },
  {
    id: 3,
    name: 'Caesar Salad',
    price: 10.99,
    description: 'Fresh romaine with caesar dressing',
    category: 'Salad'
  },
  {
    id: 4,
    name: 'Chocolate Cake',
    price: 8.99,
    description: 'Rich chocolate cake with frosting',
    category: 'Dessert'
  }
];

const Products = () => {
  const [cart, setCart] = useState([]);

  const addToCart = (product) => {
    setCart([...cart, product]);
    alert(`${product.name} added to cart!`);
  };

  return (
    <div className="min-h-screen bg-gray-50 py-8">
      <div className="max-w-6xl mx-auto px-4">
        <h1 className="text-4xl font-bold text-center mb-8">Our Menu</h1>
        
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
          {sampleProducts.map(product => (
            <div key={product.id} className="bg-white rounded-lg shadow-md p-6">
              <div className="h-32 bg-gray-200 rounded-lg mb-4 flex items-center justify-center">
                <span className="text-4xl">
                  {product.category === 'Pizza' && 'üçï'}
                  {product.category === 'Burger' && 'üçî'}
                  {product.category === 'Salad' && 'ü•ó'}
                  {product.category === 'Dessert' && 'üç∞'}
                </span>
              </div>
              
              <h3 className="text-lg font-semibold mb-2">{product.name}</h3>
              <p className="text-gray-600 text-sm mb-4">{product.description}</p>
              
              <div className="flex justify-between items-center">
                <span className="text-xl font-bold text-orange-500">
                  ${product.price}
                </span>
                <button
                  onClick={() => addToCart(product)}
                  className="bg-orange-500 text-white px-4 py-2 rounded-lg hover:bg-orange-600"
                >
                  Add to Cart
                </button>
              </div>
              
              <div className="mt-2">
                <span className="inline-block px-2 py-1 bg-orange-100 text-orange-800 text-xs rounded-full">
                  {product.category}
                </span>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Products;
